import React from "react";

import { NeuCard, NeuHeading } from "neumorphic-ui";

function Header() {
  return (
    <div className="wrapper">
      <NeuCard width="50%" height="500px">
        <NeuHeading text="MEME" fontSize="64px" fontWeight="bold" />
      </NeuCard>
    </div>
  );
}

export default Header;
